      SELECT * FROM tab2 (FORMAT parquet) WHERE NOT - col0 <> - col2 * col0 OR - 33 * + 63 * - - col2 IS NOT NULL;
  - name: tab2

outputs:
  - name: q5116.out
    data: |
      46	51	23
      64	77	40
      75	67	58
